  `CREATED_BY` int(11) NOT NULL DEFAULT '1' COMMENT '创建人',
  `CREATED_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `LAST_UPD_BY` int(11) DEFAULT NULL COMMENT '最近修改人',
  `LAST_UPD_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最近修改时间',
  `MODIFICATION_NUM` int(11) NOT NULL DEFAULT '0' COMMENT '修改次数',
  `COUNTRY_CODE` varchar(32) NOT NULL COMMENT '国家代码: 三位字母代码。',
  `COUNTRY_CODE2` varchar(32) NOT NULL COMMENT '国家代码: 两位字母代码。',
  `COUNTRY_CODEN` varchar(32) DEFAULT NULL COMMENT '国家代码: 数字代码代码。',
  `COUNTRY_NAME` varchar(254) DEFAULT NULL COMMENT '国家名称: 中文国家名称。',
  `COUNTRY_NAME_EN` varchar(254) DEFAULT NULL COMMENT '国家名称(英): 英文国家名称。',
  `SHORT_NAME` varchar(50) DEFAULT NULL,
  `SHORT_NAME_EN` varchar(32) DEFAULT NULL,
  `SORT_CODE` varchar(32) DEFAULT NULL,
