-- ----------------------------
-- Table structure for `cr_contact_montrep`
-- ----------------------------
DROP TABLE IF EXISTS `cr_contact_montrep`;
CREATE TABLE `cr_contact_montrep` (
  `ROW_ID` int(11) NOT NULL COMMENT '行号',
  `CREATED_BY` int(11) NOT NULL DEFAULT '1' COMMENT '创建人',
  `CREATED_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `LAST_UPD_BY` int(11) DEFAULT NULL COMMENT '最近修改人',
  `LAST_UPD_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最近修改时间',
  `MODIFICATION_NUM` int(11) NOT NULL DEFAULT '0' COMMENT '修改次数',
  `COMPANY_ID` int(11) DEFAULT NULL,
  `DEPARTMENT_ID` int(11) DEFAULT NULL COMMENT '用于按部门统计数据',
  `CONTRACT_ID` int(11) DEFAULT NULL COMMENT '合同号',
  `APPLY_ID` int(11) DEFAULT NULL COMMENT '关联月结业务申请单。只在做过月结业务后，再关联月结业务申请单ID。',
  `CONTMONRE_NO` varchar(32) DEFAULT NULL COMMENT '年月',
  `BEGICONCO_MONEY` decimal(22,7) DEFAULT NULL COMMENT '首期为合同借款本金，下一期取上一期的期末余额。对于客户向第三方偿还的合同（按揭、融资），则不跟踪本金余额。始终为空。',
  `BEGIRECCO_MONEY` decimal(22,7) DEFAULT NULL COMMENT '首期为0。对于按揭、融资则为公司上一期代垫本金余额。',
  `BEGIRECAC_MONEY` decimal(22,7) DEFAULT NULL COMMENT '首期为0。对于按揭、融资为上一期公司代垫的利息余额。',
  `CONTDAT_DATE` datetime DEFAULT NULL,
  `OVERDUE_COUNT` int(11) DEFAULT NULL COMMENT '对于第三方债权合同，则使用第三方月报直接更新。公司债权合同，则根据应收账收款情况统计。',
  `OVERSUM_MONEY` decimal(22,7) DEFAULT NULL COMMENT '对于第三方债权合同，则使用第三方月报直接更新。公司债权合同，则根据应收账收款情况统计。',
  `ADDRECCO_MONEY` decimal(22,7) DEFAULT NULL COMMENT '统计月报开始日期以来的新增应收账（包括合同约定还款、公司代垫）本金合计。',
  `ADDRECAC_MONEY` decimal(22,7) DEFAULT NULL COMMENT '统计月报开始日期以来的新增应收账（包括合同约定还款、公司代垫）利息合计。公司代垫的利息在每日统计月报数据时产生。',
  `PAYTOTH_MONEY` decimal(22,7) DEFAULT NULL COMMENT '直接由第三方逾期报告更新',
  `RECECOR_MONEY` decimal(22,7) DEFAULT NULL COMMENT '统计月报起始日期以来的应收款结算本金合计，包括分期款和公司代垫款的结算数据。',
  `RECEACC_MONEY` decimal(22,7) DEFAULT NULL COMMENT '统计月报起始日期以来的应收款结算利息合计，包括分期款和公司代垫款的结算数据。',
  `ENDCONCO_MONEY` decimal(22,7) DEFAULT NULL COMMENT '期初合同本金余额-实收本金',
  `RECEPUNAC_MONEY` decimal(22,7) DEFAULT NULL COMMENT '统计月报起始日期以来的结算应收账产生的罚息本金合计，包括分期款和公司代垫款的结算数据。',
  `ENDOVECOA_MONEY` decimal(22,7) DEFAULT NULL COMMENT '只对第三方债权合同计算。期初应收本息合计 + 逾期本息合计 - 实收本息合计 - 第三方回款金额',
  `ENDRECCO_MONEY` decimal(22,7) DEFAULT NULL COMMENT '期初应收本金余额 + 新增应收本金 - 实收本金',
  `ENDRECAC_MONEY` decimal(22,7) DEFAULT NULL COMMENT '期初利息余额 + 新增利息 - 实收利息',
  `STATUS` char(1) NOT NULL COMMENT '0新建，1已结账',
  `REMARK` varchar(400) DEFAULT NULL,
  PRIMARY KEY (`ROW_ID`),
  KEY `FK_REFERENCE_48` (`APPLY_ID`),
  KEY `FK_REFERENCE_49` (`CONTRACT_ID`),
  CONSTRAINT `FK_REFERENCE_48` FOREIGN KEY (`APPLY_ID`) REFERENCES `cr_contract_busiapp` (`ROW_ID`),
  CONSTRAINT `FK_REFERENCE_49` FOREIGN KEY (`CONTRACT_ID`) REFERENCES `cr_contract` (`ROW_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='描述合同各期报告。';

-- ----------------------------
-- Records of cr_contact_montrep
-- ----------------------------

-- ----------------------------
-- Table structure for `cr_contract`
-- ----------------------------
DROP TABLE IF EXISTS `cr_contract`;
CREATE TABLE `cr_contract` (
  `ROW_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '行号',
  `CREATED_BY` int(11) NOT NULL DEFAULT '1' COMMENT '创建人',
  `CREATED_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `LAST_UPD_BY` int(11) DEFAULT NULL COMMENT '最近修改人',
  `LAST_UPD_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最近修改时间',
  `MODIFICATION_NUM` int(11) NOT NULL DEFAULT '0' COMMENT '修改次数',
  `COMPANY_ID` int(11) DEFAULT NULL COMMENT '合同所属公司，是合同的主体。如果是债权合同，则说明债权主体是该公司。如果是债务合同，则债务主体是该公司。',
  `DEPARTMENT_ID` int(11) DEFAULT NULL COMMENT '签定合同部门ID',
  `CONTRACT_CODE` varchar(32) DEFAULT NULL COMMENT '公司内部合同号。与客户签定的债权偿还协议或合同的编号',
  `CONTCLA_CODE` varchar(32) DEFAULT NULL COMMENT '债权，债务，第三方债权',
  `BUSITYP_CODE` varchar(32) DEFAULT NULL COMMENT '采购分期付款合同，第三方按揭、融资租赁，本公司分期等',
  `CONFIRM_DATE` datetime DEFAULT NULL,
  `CONFADD_NAME` varchar(100) DEFAULT NULL,
  `TRANSACTOR_NAME` char(12) DEFAULT NULL,
  `THIRPAR_NAME` varchar(50) DEFAULT NULL COMMENT '具体银行、融资公司或本公司全称',
  `THIRPARTY_CODE` varchar(32) DEFAULT NULL COMMENT '银行或融资公司',
  `THIRPARCON_CODE` varchar(32) DEFAULT NULL COMMENT '第三方合同号',
  `PARTNER_ID` int(11) DEFAULT NULL COMMENT '债权合同为客户ID，债务合同为供应商ID',
  `PARTNER_NAME` varchar(50) DEFAULT NULL,
  `CONTACT_NAME` char(12) DEFAULT NULL,
  `CONTMOB_CODE` varchar(32) DEFAULT NULL COMMENT '发送短信使用该号码',
  `GUARTYP_CODE` varchar(32) DEFAULT NULL,
  `GUARID_CODE` varchar(32) DEFAULT NULL,
  `ORDER_ID` int(11) DEFAULT NULL COMMENT '与债权相关的销售订单',
  `PRODUCT_ID` int(11) DEFAULT NULL,
  `PRODSER_ID` varchar(32) DEFAULT NULL,
  `FIRSPAY_MONEY` decimal(22,7) DEFAULT NULL,
  `SECURITY_MONEY` decimal(22,7) DEFAULT NULL,
  `CORPUS_MONEY` decimal(22,7) DEFAULT NULL COMMENT '签定合同时约定的本金',
  `RELEMON_DATE` datetime DEFAULT NULL,
  `PERICLA_CODE` varchar(32) DEFAULT NULL COMMENT '按年、按季度、按月',
  `PERCO_COUNT` int(11) DEFAULT NULL,
  `PAYST_DATE` datetime DEFAULT NULL COMMENT '合同签定的执行收款的开始日期',
  `PAYEN_DATE` datetime DEFAULT NULL COMMENT '合同签定的执行收款的截止日期',
  `PEREN_DATE` datetime DEFAULT NULL,
  `ACCTY_CODE` varchar(32) DEFAULT NULL,
  `INTYE_RATE` decimal(6,5) DEFAULT NULL COMMENT '按小数记，如0.05428（5.428%）',
  `PUNIINTYE_RATE` decimal(6,5) DEFAULT NULL COMMENT '利息年利率*(1+罚息上浮率)',
  `ACCRUAL_MONEY` decimal(22,7) DEFAULT NULL COMMENT '合同签定时计算的利息',
  `TOTAL_MONEY` decimal(22,7) DEFAULT NULL,
  `BANK_NAME` varchar(50) DEFAULT NULL,
  `BANKACC_CODE` varchar(32) DEFAULT NULL,
  `REMARK` varchar(400) DEFAULT NULL,
  `ISVALID` char(1) DEFAULT NULL,
  `PROCSTA_CODE` varchar(32) DEFAULT NULL COMMENT '信贷手续办理状态。准备客户资料，待办上牌，抵押登记，待转首付，待开发票，已放款。',
  `STATUS` char(1) NOT NULL,
  `FINITYP_CODE` varchar(32) DEFAULT NULL,
  PRIMARY KEY (`ROW_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='债权债务合同或协议的经济信息';

-- ----------------------------
-- Records of cr_contract
-- ----------------------------

