  `APPLY_NO` varchar(32) DEFAULT NULL,
  `CONTRACT_ID` int(11) DEFAULT NULL,
  `CONTPER_NO` int(11) DEFAULT NULL COMMENT '合同变更时的还款期数',
  `BUSITYP_CODE` varchar(32) DEFAULT NULL COMMENT '定义合同变更的业务类型。月结、第三方回款、代垫、利率变更，提前还款，债权关闭（具体原因有结清、拖机、留购等）。',
  `REASON_TEXT` varchar(100) DEFAULT NULL COMMENT '发生变更的原因',
