  `CONTTYP_CODE` varchar(32) DEFAULT NULL COMMENT '公司垫款，银行按揭，融资租赁',
  `STARPER_DATE` datetime DEFAULT NULL COMMENT '利率变更业务填写。从该期数开始到最后一期变更年利率、利息、罚息年利率。',
  `INTRACCYE_RATE` decimal(6,5) DEFAULT NULL COMMENT '利率变更业务填写',
  `INTRPUNYE_RATE` decimal(6,5) DEFAULT NULL COMMENT '利率变更业务填写',
  `PREPAY_MONEY` decimal(22,7) DEFAULT NULL COMMENT '垫资业务填写',
  `PREPAY_DATE` datetime DEFAULT NULL COMMENT '垫资业务填写',
  `PREPEND_DATE` datetime DEFAULT NULL COMMENT '垫资业务填写',
  `PREPINTYE_RATE` decimal(6,5) DEFAULT NULL COMMENT '垫资业务填写',
  `ACCOUNT_DATE` datetime DEFAULT NULL,
  `ACCOUNT_NO` varchar(32) DEFAULT NULL,
  `ACCOPOI_DATE` datetime DEFAULT NULL COMMENT '月结业务填写',
  `ACCOSTA_DATE` datetime DEFAULT NULL COMMENT '月结业务填写',
  `ACCOEND_DATE` datetime DEFAULT NULL COMMENT '月结业务填写',
  `ENDTYP_CODE` varchar(32) DEFAULT NULL COMMENT '留购、拖机、法院',
  `REMARK` varchar(400) DEFAULT NULL,
  `STATUS` char(1) NOT NULL COMMENT '业务申请的处理状态',
  `APPLYER_ID` int(11) DEFAULT NULL,
  `APPLYER_NAME` char(12) DEFAULT NULL,
  `APPLY_DATE` datetime DEFAULT NULL COMMENT '申请人提交申请的日期',
  `AUDITOR_ID` int(11) DEFAULT NULL,
  `AUDITOR_NAME` char(12) DEFAULT NULL,
  `AUDIT_DATE` datetime DEFAULT NULL COMMENT '审核人审核日期',
  PRIMARY KEY (`ROW_ID`),
  KEY `FK_REFERENCE_50` (`CONTRACT_ID`),
  CONSTRAINT `FK_REFERENCE_50` FOREIGN KEY (`CONTRACT_ID`) REFERENCES `cr_contract` (`ROW_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='合同相关业务申请单。';

