-- ----------------------------
-- Table structure for `fi_cadetail`
-- ----------------------------
DROP TABLE IF EXISTS `fi_cadetail`;
CREATE TABLE `fi_cadetail` (
  `ROW_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '行号',
  `CREATED_BY` int(11) NOT NULL DEFAULT '1' COMMENT '创建人',
  `CREATED_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `LAST_UPD_BY` int(11) DEFAULT NULL COMMENT '最近修改人',
  `LAST_UPD_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最近修改时间',
  `MODIFICATION_NUM` int(11) NOT NULL DEFAULT '0' COMMENT '修改次数',
  `COMPANY_ID` int(11) DEFAULT NULL,
  `BUSIBIL_ID` int(11) DEFAULT NULL COMMENT '产生应收账的业务单据ID',
  `BUSIBIL_NO` varchar(32) DEFAULT NULL COMMENT '产生应收账的业务单据NO',
  `CLASS_CODE` char(10) DEFAULT NULL COMMENT '应收、应付',
  `TYPE_CODE` varchar(32) DEFAULT NULL COMMENT '合同约定收款，垫资款，应付预收款',
  `CONTRACT_ID` int(11) DEFAULT NULL,
  `CONTRACT_NO` varchar(32) DEFAULT NULL,
  `PARTNER_ID` int(11) DEFAULT NULL,
  `PARTNER_NAME` varchar(50) DEFAULT NULL,
  `PERIOD_NO` int(11) DEFAULT NULL COMMENT '与合同收款计划关联',
  `TRANSACTION_DATE` datetime DEFAULT NULL COMMENT '交易发生的日期',
  `CONTEND_DATE` datetime DEFAULT NULL COMMENT '双方约定买方还款截止日期，超过日期将产生逾期与罚息',
  `CORPUS_MONEY` decimal(22,7) DEFAULT NULL COMMENT '合同附件付款计划单上的的本金，合同开始执行即固定不变。',
  `INTRYEA_RATE` decimal(6,5) DEFAULT NULL COMMENT '合同签定时约定的执行利率，或者国家利率调整后更新的利率。',
  `ACCRUAL_MONEY` decimal(22,7) DEFAULT NULL COMMENT '根据年利率计算的利息',
  `TOTAL_MONEY` decimal(22,7) DEFAULT NULL,
  `INTRPUN_RATE` decimal(6,5) DEFAULT NULL COMMENT '根据年利率的调整可能会跟着调整',
  `REMARK` varchar(400) DEFAULT NULL,
  `RECECOR_MONEY` decimal(22,7) DEFAULT NULL COMMENT '合同执行时与当期本金相同，当客户发生还款对其进行扣减，扣到零为止。当还款截止日期到时，根据应收本金+利息，如果大于0表示逾期，否则结清。',
  `RECEACC_MONEY` decimal(22,7) DEFAULT NULL COMMENT '客户还款优先扣减当前应收利息，利息扣完再扣本金。',
  `PUNIACC_MONEY` decimal(22,7) DEFAULT NULL COMMENT '每次结算产生罚息则进行累计',
  `ISOVERDUE` char(1) DEFAULT NULL COMMENT '记录是否曾经发生过逾期',
  `STATUS` char(1) NOT NULL COMMENT '0正在执行，1结清，2坏账',
  PRIMARY KEY (`ROW_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='CA（current account）。应收应付账明细，记录应收账状态数据。客户结算先计算罚息，从结算金额中扣除罚息，再';

