  `BUSIBIL_ID` int(11) DEFAULT NULL COMMENT '台账关联的业务单据ID',
  `CONTRACT_ID` int(11) DEFAULT NULL COMMENT '关联债权债务合同',
  `PARTNER_ID` int(11) DEFAULT NULL,
  `TRANSACTION_DATE` datetime DEFAULT NULL,
  `BOOKTYP_CODE` varchar(32) DEFAULT NULL COMMENT '合同应收款，应收款核销，应付预收款（收款金额核销完应收款后剩余的款作为预收款，再次产生应收款时优先冲减应付预收款），公司垫资款',
