  `PUNIINTYE_RATE` decimal(6,5) DEFAULT NULL COMMENT '产生罚息的年利率',
  `UPDAPUNAC_MONEY` decimal(22,7) DEFAULT NULL,
  `BALACOR_MONEY` decimal(22,7) DEFAULT NULL COMMENT '每一笔应收账的本金余额',
  `BALAACC_MONEY` char(10) DEFAULT NULL,
  `BALAPUNAC_MONEY` char(10) DEFAULT NULL,
  `REMARK` varchar(400) DEFAULT NULL,
  PRIMARY KEY (`ROW_ID`),
  KEY `FK_REFERENCE_42` (`RECEDET_ID`),
  CONSTRAINT `FK_REFERENCE_42` FOREIGN KEY (`RECEDET_ID`) REFERENCES `fi_cadetail` (`ROW_ID`)
) ENGINE=InnoDB DEFAULT CHARSET=gbk COMMENT='记录每一笔应收、应付账余额变动数据';

