  `ROW_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '行号',
  `CREATED_BY` int(11) NOT NULL DEFAULT '1' COMMENT '创建人',
  `CREATED_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `LAST_UPD_BY` int(11) DEFAULT NULL COMMENT '最近修改人',
  `LAST_UPD_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最近修改时间',
  `MODIFICATION_NUM` int(11) NOT NULL DEFAULT '0' COMMENT '修改次数',
  `ORIGIN_FLAG` char(1) DEFAULT NULL COMMENT '数据来源的标志：[]或[I]-(Input)系统录入;[O]-(Out)外部接口导入;[S]-(System)系统保留。本标志不能挪为它用。',
  `ORGTYPE_CODE` varchar(32) NOT NULL,
  `ORGTYPE_NAME` varchar(255) DEFAULT NULL,
  `SUPER_ID` int(11) DEFAULT NULL,
  `REMARKS` varchar(400) DEFAULT NULL,
  `BIG_ICON_NAME` varchar(254) DEFAULT NULL COMMENT '大图标名称: 文件名称，该值为空时，图标从大图标中获取。',
  `BIG_ICON` blob COMMENT '大图标: 32*32像素256色位图，或其他格式图片。',
  `SMALL_ICON_NAME` varchar(254) DEFAULT NULL COMMENT '小图标名称: 文件名称，该值为空时，图标从小图标中获取。',
  `SMALL_ICON` blob COMMENT '小图标: 16*16像素16色位图，或其他格式图片。',
  `STATUS` char(1) NOT NULL DEFAULT '0' COMMENT '状态:0 停用，1 正常。',
  PRIMARY KEY (`ROW_ID`),
  KEY `AK_AK_ORG_TYPE` (`ORGTYPE_CODE`)
) ENGINE=InnoDB AUTO_INCREMENT=12024 DEFAULT CHARSET=gbk COMMENT='组织机构的分类，如法人(公司)、职能部门、班组、员工等级别的内部组织，另还有零售户、供应商等外部组织。某些类型将在业务逻';

-- ----------------------------
-- Records of md_org_type
