DROP TABLE IF EXISTS `md_org_unit`;
CREATE TABLE `md_org_unit` (
  `ROW_ID` int(11) NOT NULL AUTO_INCREMENT COMMENT '行号',
  `CREATED_BY` int(11) NOT NULL DEFAULT '1' COMMENT '创建人',
  `CREATED_TIME` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `LAST_UPD_BY` int(11) DEFAULT NULL COMMENT '最近修改人',
  `LAST_UPD_TIME` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00' COMMENT '最近修改时间',
  `MODIFICATION_NUM` int(11) NOT NULL DEFAULT '0' COMMENT '修改次数',
  `ORG_TYPE` varchar(32) DEFAULT NULL,
  `PARENT_UNIT` int(11) DEFAULT NULL,
  `ALT_ORG` int(11) DEFAULT NULL COMMENT '替代组织: 用于记录组织被撤并时，该组织的历史数据归属。',
  `UNIT_CODE` varchar(32) NOT NULL,
  `SHORT_CODE` varchar(32) DEFAULT NULL,
  `SORT_CODE` varchar(32) DEFAULT NULL COMMENT '排序码: 用于同级别组织间的排序。',
  `UNIT_NAME` varchar(255) DEFAULT NULL,
  `SHORT_NAME` varchar(32) DEFAULT NULL,
  `ADDRESS` varchar(255) DEFAULT NULL COMMENT '地址: 缺省的地址。',
  `TEL` varchar(30) DEFAULT NULL COMMENT '联系电话: 缺省的联系电话。',
  `FAX` varchar(30) DEFAULT NULL COMMENT '传真: 缺省的传真号码。',
  `POSTALCODE` varchar(30) DEFAULT NULL COMMENT '邮政编码: 缺省地址的邮编。',
  `EMAIL` varchar(255) DEFAULT NULL,
  `URL` varchar(255) DEFAULT NULL,
  `PERMIT_NO` varchar(32) DEFAULT NULL COMMENT '许可证号: 销售单位的专卖许可证号。',
  `LEGAL_PERSON` varchar(50) DEFAULT NULL COMMENT '法人代表: 具有法人资格的公司需要维护该属性。',
  `BEGIN_DATE` date DEFAULT NULL,
  `ACCCLOSE_DAY` int(11) DEFAULT NULL,
  `BIZ_DATE` date DEFAULT NULL,
  `BIZ_MONTH` date DEFAULT NULL,
  `BANK` varchar(255) DEFAULT NULL,
  `ACCOUNT_NO` varchar(32) DEFAULT NULL,
  `TAX_NO` varchar(32) DEFAULT NULL,
  `TAX_RATE` decimal(22,7) DEFAULT NULL,
  `CALC_MODE` char(1) DEFAULT NULL COMMENT '核算模式: 是存货成本计算的模式，1 全月加权平均，2 移动加权平均，3 先进先出，4 后进先出，5 个别计价。',
  `DEFAULT_UNIT` varchar(32) DEFAULT NULL,
  `COMPANY_LEVEL` char(1) DEFAULT NULL COMMENT '公司级别: 0 中国烟草总公司，1 省烟草公司，2 市（地区、州、盟）公司，3 县（区、旗）公司。',
  `CODE_P1` varchar(32) DEFAULT NULL COMMENT '国家局代码: 用于数据上报、一号工程数据衔接。',
  `IS_MAIN` char(1) NOT NULL DEFAULT 'N' COMMENT '营销主体: 指具体自主完整的采购、销售机构的经营单位。',
  `REGIONALISM` varchar(32) DEFAULT NULL,
  `COMPANY_ID` int(11) DEFAULT NULL,
  `STOP_ID` int(11) DEFAULT NULL COMMENT '停靠点: 部门所在地的行车地理位置，在使用线路优化是启用。',
  `HL_DEPT` int(11) DEFAULT NULL COMMENT '上级主管部门: 所在公司的上级公司相应职能部门。',
  `ACREAGE` decimal(22,7) DEFAULT NULL COMMENT '面积: 仓库、中转站房的存储面积。',
  `MAX_CAPACITY` decimal(22,7) DEFAULT NULL COMMENT '最大容量: 仓库、中转站房能够存储货物的数量。',
  `IS_LOCATION` char(1) NOT NULL DEFAULT 'N' COMMENT '是否仓储地点: 即物流配送中心。一个公司可以具有多个物流中心(仓储地点)，物流中心具有仓储、分拣、送货的完整作业配置。',
  `IS_WAREHOUSE` char(1) NOT NULL DEFAULT 'N' COMMENT '是否仓库: 是物流中心或者隶属于物流中心，负责货品的存储、分拣作业。',
  `IS_VISITSALES` char(1) NOT NULL DEFAULT 'N' COMMENT '是否访销: 隶属于营销中心，负责电话访销。',
  `IS_MARKET` char(1) NOT NULL DEFAULT 'N' COMMENT '营销组织: 营销中心或者隶属于营销中心，是市场经理(客户经理)的组织，负责客户关系管理、经营管理。',
  `DISTRIBUTION_CENTER` int(11) DEFAULT NULL,
  `IS_DELIVERY` char(1) NOT NULL DEFAULT 'N' COMMENT '送货组织: 物流中心或者隶属于物流中心的中转站，负责将货品送达订货客户。',
  `RESERVE_TAG1` char(1) DEFAULT NULL,
  `RESERVE_TAG2` char(1) DEFAULT NULL,
  `RESERVE_TAG3` char(1) DEFAULT NULL,
  `RESERVE_CODE1` varchar(32) DEFAULT NULL,
  `RESERVE_CODE2` varchar(32) DEFAULT NULL,
  `RESERVE_CODE3` varchar(32) DEFAULT NULL,
  `MANAGER_ID` int(11) DEFAULT NULL,
  `DEPT_ID` int(11) DEFAULT NULL,
  `AT_TYPE_ID` varchar(32) DEFAULT NULL COMMENT '作业类型: 类型列表见分类代码类别"OS02"。',
  `OPERATING_STATE` char(1) NOT NULL DEFAULT '0' COMMENT '作业状态: 0 正常，1 在班，2 休息，9 撤销',
  `REMARKS` varchar(400) DEFAULT NULL,
  `STATUS` char(1) NOT NULL DEFAULT '0' COMMENT '状态: 0 停用，1 有效。',
  `is_service` char(1) DEFAULT NULL COMMENT '负责维修、保养工作',
  PRIMARY KEY (`ROW_ID`),
  KEY `FK_ORG_REF_ORGTYPE` (`ORG_TYPE`),
  CONSTRAINT `FK_ORG_REF_ORGTYPE` FOREIGN KEY (`ORG_TYPE`) REFERENCES `md_org_type` (`ORGTYPE_CODE`)
) ENGINE=InnoDB AUTO_INCREMENT=1144030418 DEFAULT CHARSET=gbk COMMENT='描述运行系统单位的组织结构，具体组织机构类型见组织类型表。\n法人代表属性至是否营销主体属性是公司类组织机构所';

