-- ----------------------------
-- Procedure structure for `P_SM_GET_BILL_NO`
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_SM_GET_BILL_NO`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `P_SM_GET_BILL_NO`(IN V_SERIES_CODE VARCHAR(32), 
  IN V_DATE DATE, 
  OUT BILLNO VARCHAR(30)
 )
begin
	DECLARE i		int default 1;
	DECLARE vPrefix		varchar(32);
	DECLARE vRestart	char(1);
	DECLARE vCurrentDate	varchar(32) ;
	DECLARE vNextSeq	int;
	DECLARE vLastOrder	varchar(32);
	DECLARE vDateTemp	varchar(32);
	DECLARE j		int;
	DECLARE vOrderLength	int;
	DECLARE vSeqLength	int;
	DECLARE vSeqStr		varchar(32);
	DECLARE tDate		date;

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET i = 0;
	 
	SELECT	BIZ_DATE INTO tDate FROM MD_ORG_UNIT WHERE IS_MAIN = 'Y';
	SELECT LOCATE(DATE_FORMAT(tDATE,DATE_TEMP),	LAST_ORDER_NUM),IS_RESTART,DATE_TEMP INTO j,vRestart,vDateTemp 
    FROM  SM_ORDER_NUM 
	WHERE SERIES_CODE = V_SERIES_CODE ;
	 
    UPDATE SM_ORDER_NUM
    SET	LAST_ORDER_NUM = DATE_FORMAT(tDATE,DATE_TEMP) ,
        NEXT_SEQ_NO    = CASE WHEN (j <= 0 OR j IS NULL) AND vRestart = 'Y' AND vDateTemp <> '' THEN 1 ELSE NEXT_SEQ_NO + 1 END 
    WHERE	SERIES_CODE = V_SERIES_CODE;

	SELECT	IS_RESTART, IFNULL(PREFIX,''), DATE_FORMAT(tDATE,DATE_TEMP), NEXT_SEQ_NO,
		LAST_ORDER_NUM, DATE_TEMP,  SERIAL_LENGTH
	INTO	vRestart, vPrefix, vCurrentDate, vNextSeq, vLastOrder, vDateTemp,  vOrderLength
	FROM SM_ORDER_NUM
    WHERE SERIES_CODE = V_SERIES_CODE;

	if i = 1 then
		if j <= 0 and vRestart = 'Y' and vDateTemp <> '' then
			set vNextSeq = 0;
		end if;
		set vSeqLength = vOrderLength - length(vDateTemp) - length(vPrefix) - length(cast(vNextSeq+1 as char)) ;
		set vSeqStr = cast(vNextSeq+1 as char);
		body:
		loop
			if vSeqLength <= 0 then
				leave body;
			end if;
			set vSeqStr = concat('0',vSeqStr);
			set vSeqLength = vSeqLength - 1;
		end loop;
		set BILLNO = concat(vPrefix,vCurrentDate,vSeqStr);
	else
		set BILLNO = '-1';
	end if;
end
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `P_SM_GET_ROW_ID`
-- ----------------------------
DROP PROCEDURE IF EXISTS `P_SM_GET_ROW_ID`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `P_SM_GET_ROW_ID`( OUT V_NEWROWID INTEGER )
BEGIN
    SELECT LAST_INSERT_ID() INTO V_NEWROWID;
    DELETE FROM SM_ROWID;
END
;;
DELIMITER ;

-- ----------------------------
-- Function structure for `F_SM_GET_ROW_ID`
-- ----------------------------
DROP FUNCTION IF EXISTS `F_SM_GET_ROW_ID`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` FUNCTION `F_SM_GET_ROW_ID`() RETURNS int(11)
    NO SQL
BEGIN
DECLARE NEWID INTEGER DEFAULT 1;
SELECT 1 INTO NEWID;
CALL P_SM_GET_ROW_ID(NEWID);
RETURN NEWID;
END
;;
DELIMITER ;
